import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import {XCircle} from 'react-feather';

function error() {
    return (
        <section className = "error">
            <Container>
                <Row>
                    <Col>
                        <XCircle></XCircle>
                    </Col>
                </Row>
            </Container>
            
        </section>
    )
}

export default error
